jmsServerInsertionPausedAtStartup = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 660, 1, 71), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmsServerInsertionPausedAtStartup.setStatus('current')
if mibBuilder.loadTexts: jmsServerInsertionPausedAtStartup.setDescription("Indicates whether insertion is paused at startup on destinations targeted to this JMS server. A destination cannot receive any new messages while it is paused. When the value is set to true, then immediately after the host server instance is booted, then this JMS server and its targeted destinations are modified such that they are in a 'insertion paused' state, which results preventing messages that are result of the 'in-flight' work completion to arrive on those destinations. Note: For a detailed definition of 'in-flight' work/messages, see weblogic.management.runtime.JMSServerRuntimeMBean#resumeInsertion and weblogic.management.runtime.JMSDestinationRuntime#resumeInsertion To allow in-flight work messages to appear on the destinations, later you will have to change the state of this JMS server to an 'insertion enabled' state by setting this value to false, and then either redeploy the JMS server or reboot the hosting server instance. When the value is set to default, then the Insertion Paused At Startup is determined based on the corresponding setting on the individual destination.")
jmsServerStoreEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 660, 1, 72), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmsServerStoreEnabled.setStatus('current')
if mibBuilder.loadTexts: jmsServerStoreEnabled.setDescription("Specifies whether message persistence is supported for this JMS server. When set to true, the default, then if the JMS server has no store configured, the targeted WebLogic Server instance's default store is used to store persistent messages. When set to false, then this JMS server does not support persistent messages, and instead downgrades them to non-persistent. BEA recommends not setting this parameter to false. It is available to provide compatibility with older releases.")
jmsServerAllowsPersistentDowngrade = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 660, 1, 73), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmsServerAllowsPersistentDowngrade.setStatus('current')
if mibBuilder.loadTexts: jmsServerAllowsPersistentDowngrade.setDescription('Specifies whether JMS clients will get an exception when sending persistent messages to a destination targeted to a JMS server that does not have a persistent store configured. This parameter only has effect when the Store Enabled parameter is disabled (false). When set to false, the default, clients will get an exception when sending persistent messages to a JMS server with no store configured. When set to true, then persistent messages are downgraded to non-persistent; however, the send operations are allowed to continue.')
jmsServerExpirationScanInterval = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 660, 1, 74), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmsServerExpirationScanInterval.setStatus('current')
if mibBuilder.loadTexts: jmsServerExpirationScanInterval.setDescription("The number of seconds between this JMS server's cycles of scanning local destinations for expired messages. A value of 0 disables active scanning. A very large scan interval effectively disables active scanning. With scanning disabled, users still do not receive expired messages and any expired messages that are discovered by other system activities are removed. However, expired messages sitting in idle destinations (such as an inactive queue or disconnected durable subscriber) are not removed and continue to consume system resources. The scanning cycle for expired messages occurs as follows: After the specified waiting period, the JMS server devotes a separate thread to scan all of its local destinations for expired messages. After the scanning is completed, all located expired messages are processed according to the specified Expiration Policy on the destination (Discard, Log, or Redirect). The entire process repeats after another specified waiting period. Note: Because a new scan does not start until the current one is finished and until the specified waiting period ends, an expired message could still remain in the system for the maximum scan waiting period plus the amount of time it takes to perform the scan.")
jmsServerProductionPausedAtStartup = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 660, 1, 75), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmsServerProductionPausedAtStartup.setStatus('current')
if mibBuilder.loadTexts: jmsServerProductionPausedAtStartup.setDescription("Specifies whether production is paused at server startup on destinations targeted to this JMS server. A destination cannot receive any new messages while it is paused. When the value is set to true, then immediately after the host server instance is rebooted, then this JMS server and its targeted destinations are modified such that they are in a 'production paused' state, which results in preventing new message production activities on those destinations. To resume normal new message production activity, later you will have to change the state of this JMS server to a 'production enabled' state by setting this value to false, and then either redeploy the JMS server or reboot the hosting server instance. When the value is set to default, then the Production Paused At Startup is determined based on the corresponding setting on the individual destination.")
jmsServerTemporaryTemplateName = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 660, 1, 76), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmsServerTemporaryTemplateName.setStatus('current')
if mibBuilder.loadTexts: jmsServerTemporaryTemplateName.setDescription('The name of a configured JMS template that this JMS server uses to create temporary destinations. Entering a template name, requires you to specify the JMS module that contains this template. However, a template name cannot be specified if the Hosting Temporary Destinations field is disabled. Note: If the specified JMS template provides persistent store values, they are ignored because temporary destinations do not support persistent messaging.')
jmsServerMaximumMessageSize = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 660, 1, 77), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmsServerMaximumMessageSize.setStatus('current')
if mibBuilder.loadTexts: jmsServerMaximumMessageSize.setDescription('The maximum number of bytes allowed in individual messages on this JMS server. The size of a message includes the message body, any user-defined properties, and the user-defined JMS header fields JMSCorrelationID and JMSType. The maximum message size is only enforced for the initial production of a message. Messages that are redirected to an error destination or forwarded to a member of a distributed destination are not checked for size. For instance, if a destination and its corresponding error destination are configured with a maximum message size of 128K bytes and 64K bytes, respectively, a message of 96K bytes could be redirected to the error destination (even though it exceeds the 64K byte maximum), but a producer could not directly send the 96K byte message to the error destination. Note: Any change to this maximum affects only incoming messages; stored messages are not affected.')
jmsServerDeploymentOrder = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 660, 1, 78), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmsServerDeploymentOrder.setStatus('current')
if mibBuilder.loadTexts: jmsServerDeploymentOrder.setDescription('A priority that the server uses to determine when it deploys an item. The priority is relative to other deployable items of the same type. For example, the server prioritizes and deploys all EJBs before it prioritizes and deploys startup classes. Items with the lowest Deployment Order value are deployed first. There is no guarantee on the order of deployments with equal Deployment Order values. There is no guarantee of ordering across clusters.')
jmsServerMessageBufferSize = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 660, 1, 79), Counter64()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmsServerMessageBufferSize.setStatus('current')
if mibBuilder.loadTexts: jmsServerMessageBufferSize.setDescription('The amount of memory (in bytes) that this JMS server can use to store message bodies before it writes them to disk. When the JMS server writes the message bodies to disk, it clears them from memory. A value of -1 (the default) specifies that the server will automatically determine a size based on the maximum heap size of the JVM. This default will be set to either one-third the maximum heap size, or 512 megabytes, whichever is larger. The larger the buffer, the more memory JMS will consume when many messages are waiting on queues or topics. Once the buffer is surpassed, JMS may write message bodies to the directory specified by PagingDirectory in an effort to reduce memory usage below this buffer. Surpassing the buffer size does not stop the JMS server from accepting new messages. It is still possible to run out of memory if messages are arriving faster than they can be written to disk. Users with high messaging loads who wish to support the highest possible availability should consider setting a quota or setting a threshold and enabling flow control. Paging is always supported.')
jmsServerBlockingSendPolicy = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 660, 1, 80), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmsServerBlockingSendPolicy.setStatus('current')
if mibBuilder.loadTexts: jmsServerBlockingSendPolicy.setDescription('Determines whether the JMS server delivers smaller messages before larger ones when a destination has exceeded its maximum number of messages. FIFO prevents the JMS server from delivering smaller messages when larger ones are already waiting for space. Preemptive allows smaller send requests to preempt previous larger ones when there is sufficient space for smaller messages on the destination. This policy is defined only for the JMS server; it cannot be set on individual destinations. Additional information on the FIFO and Preemptive policies is provided below. FIFO (first in, first out) indicates that all send requests for the same destination are queued up one behind the other until space is available. No send request is permitted to successfully complete if there is another send request waiting for space before it. When space is limited, the FIFO policy prevents the starvation of larger requests because smaller requests cannot continuously use the remaining available space. Smaller requests are delayed, though not starved, until the larger request can be completed. When space does become available, requests are considered in the order in which they were made. If there is sufficient space for a given request, then that request is completed and the next request is considered. If there is insufficient space for a given request, then no further requests are considered until sufficient space becomes available for the current request to complete. Preemptive indicates that a send operation can preempt other blocking send operations if space is available. That is, if there is sufficient space for the current request, then that space is used even if there are other requests waiting for space. When space is limited, the Preemptive policy can result in the starvation of larger requests. For example, if there is insufficient available space for a large request, then it is queued up behind other existing requests. When space does become available, all requests are considered in the order in which they were originally made. If there is sufficient space for a given request, then that request is allowed to continue and the next request is considered. If there is insufficient space for a given request, then that request is skipped and the next request is considered.')
jmsServerHostingTemporaryDestinations = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 660, 1, 81), OctetString()).setMaxAccess("readonly")
