serverClientCertProxyEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 730, 1, 301), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: serverClientCertProxyEnabled.setStatus('current')
if mibBuilder.loadTexts: serverClientCertProxyEnabled.setDescription('Specifies whether the HttpClusterServlet proxies the client certificate in a special header. By default (or if you specify false), the weblogic.xml deployment descriptor for each web application that is deployed on this server determines whether the web application trusts certificates sent from the proxy server plugin. By default (or if the deployment descriptor specifies false), users cannot log in to the web application from a proxy server plugin. A value of true causes proxy-server plugins to pass identity certifications from clients to all web applications that are deployed on this server instance. A proxy-server plugin encodes each identify certification in the WL-Proxy-Client-Cert header and passes the header to WebLogic Server instances. A WebLogic Server instance takes the certificate information from the header, trusting that it came from a secure source, and uses that information to authenticate the user. If you specify true, use a weblogic.security.net.ConnectionFilter to ensure that this WebLogic Server instance accepts connections only from the machine on which the proxy-server plugin is running. Specifying true without using a connection filter creates a security vulnerability because the WL-Proxy-Client-Cert header can be spoofed. A cluster can also specify whether the HttpClusterServlet proxies the client certificate in a special header. The cluster-level setting overrides the setting in individual servers that are part of the cluster.')
serverRestartDelaySeconds = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 730, 1, 302), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: serverRestartDelaySeconds.setStatus('current')
if mibBuilder.loadTexts: serverRestartDelaySeconds.setDescription('The number of seconds the Node Manager should wait before restarting this server. After killing a server process, the system might need several seconds to release the TCP port(s) the server was using. If Node Manager attempts to restart the Managed Server while its ports are still active, the startup attempt fails. If AutoMigration is enabled and RestartDelaySeconds is 0, the RestartDelaySeconds is automatically set to the lease time. This prevents the server from failing to restart after migration when the previous lease is still valid.')
