serverOutboundEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 730, 1, 305), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: serverOutboundEnabled.setStatus('current')
if mibBuilder.loadTexts: serverOutboundEnabled.setDescription('Specifies whether new server-to-server connections may consider the default server channel when initiating a connection. This is only relevant if the connection needs to be bound to the default listen address. This will only work for binary protocols that support both outbound and inbound traffic. When this feature is not enabled, connections are initiated using a local address selected by the underlying hardware. For the default channel this is usually what is wanted for IP-routing to be effective. Note that since the default is false, other outbound channels will be considered in preference to the default channel. Default administration channels, created when the domain-wide administration port is turned on, are always considered and bound when initiating an administrative connection. To allow IP-routing for administration traffic create custom admin with {@link NetworkAccessPointMBean#isOutboundEnabled isOutboundEnabled} set to false instead of enabling the domain-wide ADMIN port.')
serverJDBCLLRTableName = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 730, 1, 306), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: serverJDBCLLRTableName.setStatus('current')
if mibBuilder.loadTexts: serverJDBCLLRTableName.setDescription("The table name for this server's Logging Last Resource (LLR) database table(s). WebLogic Server creates the table(s) and then uses them during transaction processing for the LLR transaction optimization. This setting must be unique for each server. The default table name is WL_LLR_SERVERNAME. This setting only applies if this server hosts one or more LLR-enabled JDBC data sources. The format for the tables that WebLogic Server creates is [[[catalog.]schema.]name. Each '.' in the table name is significant, and schema generally corresponds to username in many databases. IMPORTANT: If this value is changed but the LLR table already exists in the database, you must preserve the existing table's data. Consequently, when changing the table name, the existing database table must be renamed by a database administrator to match the new configured table name. Otherwise, transaction records may be lost, resulting in heuristic failures that aren't logged. IMPORTANT: Each server's table name must be unique. Multiple LLR-enabled data sources within the same server may share the same table, but multiple servers must not share the same table. If multiple same-named servers share a table, the behavior is undefined and it is likely that transactions will not recover properly after a crash, creating heuristic hazards.")
serverInterfaceAddress = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 730, 1, 307), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: serverInterfaceAddress.setStatus('current')
