serverExtraEjbcOptions = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 730, 1, 308), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: serverExtraEjbcOptions.setStatus('current')
if mibBuilder.loadTexts: serverExtraEjbcOptions.setDescription("The options passed to the EJB compiler during server-side generation. Each EJB component can override the compiler options that you specify here. The following options are valid: -forcegeneration Forces generation of wrapper classes. Without this flag the classes may not be regenerated if it is determined to be unnecessary. -disableHotCodeGen Generate ejb stub and skel as part of ejbc. Avoid HotCodeGen to have better performance. -keepgenerated Keep the generated .java files. -compiler javac Java compiler to exec. If not specified, the -compilerclass option will be used. -compilerclass com.sun.tools.javac.Main Specifies the compiler class to invoke. -g Compile debugging info into class file. -normi Passed through to Symantec's sj. -classpath path Classpath to use. -source source Source version. -Joption Flags passed through to java runtime.")
