if mibBuilder.loadTexts: messagingBridgeDurabilityEnabled.setDescription('Specifies whether or not the messaging bridge allows durable messages. When enabled and the source destination is a JMS topic, a messaging bridge instance uses a durable subscription to ensure that no messages are lost in the event of a failure. DurabilityEnabled ignored if the source destination is a JMS queue. When enabled and the source destination uses durable subscriptions, the source JMS implementation saves messages that are sent when a messaging bridge instance is not running. When the bridge instance is restarted, these messages are forwarded to the target destination. The administrator can choose not to be durable. When not enabled, messages that are sent to the source JMS implementation while the bridge instance is down cannot be forwarded to the target destination.')
messagingBridgeReconnectDelayMinimum = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 786, 1, 102), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: messagingBridgeReconnectDelayMinimum.setStatus('current')
if mibBuilder.loadTexts: messagingBridgeReconnectDelayMinimum.setDescription('The minimum amount of time, in seconds, that a messaging bridge instance waits before it tries to reconnect to the source or target destination after a failure. Use with ReconnectDelayMaximum and ReconnectDelayIncrease. After the first failure to connect to a destination, the bridge instance waits for the number of seconds defined by ReconnectDelayMinimum. Each time a reconnect attempt fails, the bridge instance increases its waiting time by the number of seconds defined by ReconnectDelayIncrease. The maximum delay time is defined by ReconnectDelayMaximum. Once the waiting time is increased to the maximum value, the bridge instance stops increase its waiting time. Once the bridge instance successfully connects to the destination, the bridge instance resets its waiting time to the initial value defined by ReconnectDelayMinimum.')
