messagingBridgeAsyncEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 786, 1, 107), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: messagingBridgeAsyncEnabled.setStatus('current')
if mibBuilder.loadTexts: messagingBridgeAsyncEnabled.setDescription('Specifies if a messaging bridge instance forwards in asynchronous messaging mode. AsyncEnabled only applies to messaging bridge instances whose source destination supports asynchronous receiving. Messaging bridges instances that forward in asynchronous mode are driven by the source destination. A messaging bridge instance listens for messages and forwards them as they arrive. When AsyncEnabled is not selected, a bridge instance is forced to work in synchronous mode, even if the source supports asynchronous receiving. Note: For a messaging bridge instance with a QOS of Exactly-once to work in asynchronous mode, the source destination has to support the MDBTransaction interface. Otherwise, the bridge automatically switches to synchronous mode if it detects that MDBTransaction is not supported by the source destination.')
messagingBridgeBatchInterval = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 786, 1, 108), Counter64()).setMaxAccess("readonly")
