if mibBuilder.loadTexts: jmxCompatibilityMBeanServerEnabled.setDescription('Enables JMX clients to use the deprecated MBeanHome interface. Prior to 9.0, WebLogic Server supported a typed API layer over its JMX layer. Your JMX application classes could import type-safe interfaces for WebLogic Server MBeans, retrieve a reference to the MBeans through the weblogic.management.MBeanHome interface, and invoke the MBean methods directly.')
jmxManagementEJBEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 975, 1, 5), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmxManagementEJBEnabled.setStatus('current')
if mibBuilder.loadTexts: jmxManagementEJBEnabled.setDescription('Enables access to the Management EJB (MEJB), which is part of the J2EE Management APIs (JSR-77). The Management API specification provides a standardized management data model for common resources on J2EE Web application servers. The MEJB provides access to J2EE Managed Objects (JMOs), which describe the common J2EE resources. If you set this attribute to false, WebLogic Server does not register the MEJB in the JNDI tree, and effectively disables the J2EE Management APIs for the domain.')
jmxPlatformMBeanServerEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 975, 1, 6), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmxPlatformMBeanServerEnabled.setStatus('current')
if mibBuilder.loadTexts: jmxPlatformMBeanServerEnabled.setDescription("Causes each WebLogic Server instance to initialize the JDK's platform MBean server and to use the platform MBean server as the Runtime MBean Server. As of JDK 1.5, JVMs provide a platform MBean server that local processes can instantiate. There can be only one instance of the platform MBean server for each JVM. When a process instantiates this MBean server, the JVM creates several platform MBeans that provide monitoring data for the JVM itself. If you set this attribute to true, each WebLogic Server instance invokes the method java.lang.management.ManagementFactory.getPlatformMBeanServer() and thus causes the initialization of the JVM's MBeans. In this case, the server's Runtime MBean Server uses the MBeanServer returned by this method as its MBeanServer. This makes it possible to access the WebLogic Server MBeans and the JVM platform MBeans from a single MBean server. In addition, if you enable the Runtime MBean Server to be the platform MBean server, local processes in the JVM can directly access this MBean server through the MBeanServer interface that java.lang.management.ManagementFactory.getPlatformMBeanServer() returns. With this local access, there are no WebLogic Server security checks to make sure that only authorized users can access WebLogic Server MBeans. Any application that is running in the JVM can access any of the WebLogic Server MBeans in the Runtime MBean Server/JDK Platform MBean Server. Do not use this configuration if you cannot control or cannot trust the applications that are running within a JVM.")
jmxInvocationTimeoutSeconds = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 975, 1, 7), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmxInvocationTimeoutSeconds.setStatus('current')
if mibBuilder.loadTexts: jmxInvocationTimeoutSeconds.setDescription("The number of seconds that internal WebLogic Server processes wait to connect to an MBean server, invoke an MBean server method, and return the results of the invocation. If the MBean server method does not complete (return) within the timeout period, WebLogic Server abandons its invocation attempt. Some internal management processes within WebLogic Server require a server instance to connect to MBean servers in other WebLogic Server instances and invoke an MBean server method. The timeout period prevents the internal process from locking up if an MBean server cannot successfully return a method invocation. A value of 0 (zero) prevents the method invocation from timing out. With such a value, the internal process will wait indefinitely until the MBean server's method returns.")
jmxRuntimeMBeanServerEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 975, 1, 8), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmxRuntimeMBeanServerEnabled.setStatus('current')
if mibBuilder.loadTexts: jmxRuntimeMBeanServerEnabled.setDescription("Specifies whether each server instance in the domain initializes its Runtime MBean Server, which provides access to a server's runtime MBeans and read-only configuration MBeans. The Administration Console and the WebLogic Scripting Tool use this MBean server for some (but not all) of their read operations. If RuntimeMBeanServerEnabled is true, each server starts its Runtime MBean Server during the server's startup cycle. If this attribute is false, no server instance in the domain will start its Runtime MBean Server.")
jmxDomainMBeanServerEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 975, 1, 9), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmxDomainMBeanServerEnabled.setStatus('current')
if mibBuilder.loadTexts: jmxDomainMBeanServerEnabled.setDescription("Specifies whether the Administration Server initializes the Domain MBean Server, which provides federated access to all runtime MBeans and read-only configuration MBeans in the domain. Through it, JMX clients can access all MBeans in a domain through a single connection. The Administration Console and the WebLogic Scripting Tool use this MBean server for many (but not all) of their read operations. This MBean server exists only on the Administration Server. The Administration Server initializes it the first time a JMX client requests a connection to it. If you set this attribute to false, the Administration Server will not start this MBean server and JMX clients cannot connect to it. While this MBean server is instantiated lazily (only when requested), once it is instantiated it does use some memory and network traffic. Disabling this MBean server can conserve a minimal amount of resources, but the trade off is that JMX clients must maintain separate connections for each WebLogic Server's Runtime MBean Server.")
