jmxEditMBeanServerEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 975, 1, 11), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jmxEditMBeanServerEnabled.setStatus('current')
if mibBuilder.loadTexts: jmxEditMBeanServerEnabled.setDescription("Specifies whether the Administration Server initializes the Edit MBean Server, which contains the hierarchy of MBeans used to make modifications to the domain's configuration. All JMX clients, including utilities such as the Administration Console and the WebLogic Scripting Tool, use the Edit MBean Server to modify a domain's configuration. This MBean server exists only on the Administration Server. By default, when the Administration Server starts, it starts the Edit MBean Server. If you set the EditMBeanServerEnabled attribute to false, the Administration Server will not start this MBean server. If you disable this MBean server, JMX clients cannot modify the domain's configuration. You can, however, modify the domain configuration through the offline editing feature of WebLogic Scripting Tool. Note: Disabling the Edit MBean Server is not sufficient to prevent changes to a domain configuration. Because the WebLogic Server deployment service does not use JMX, the Administration Console and WLST can deploy or undeploy applications even if you have disabled the Edit MBean Server.")
