if mibBuilder.loadTexts: jtaMigratableTargetNonLocalPostAllowed.setDescription("Specifies whether or not the post-deactivation script is allowed to run on a different machine. Normally, when automigration occurs, the post-deactivation script will be run on the service's current location, and the pre-activation script on the service's new location. If the current location is unreachable for some reason, this value will be checked to see if it is safe to run it on the service's new machine. This is useful if the post-deactivation script controls access to a networked resource and does not need any data from the current machine.")
