jtaMigratableTargetPostScriptFailureFatal = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 980, 1, 8), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: jtaMigratableTargetPostScriptFailureFatal.setStatus('current')
if mibBuilder.loadTexts: jtaMigratableTargetPostScriptFailureFatal.setDescription('Specifies whether or not a failure during execution of the post-deactivation script is fatal to the migration. If it is fatal, the migratable target will not be automatically migrated until an administrator manually migrates it to a server, thus reactivating it. Note: Enabling this value will result in weakening the exactly-once guarantee. It is provided to prevent more dangerous data corruption if the post-deactivation script fails. Also if this value is enabled, then the script may be called more than once by the migration framework after the Migratable Target is deactivated or the server or machine hosting the Migratable Target crashed or is network partitioned. The script is expected not to return different exit values when invoked multiple times in such scenarios.')
