if mibBuilder.loadTexts: safAgentConversationIdleTimeMaximum.setStatus('current')
if mibBuilder.loadTexts: safAgentConversationIdleTimeMaximum.setDescription('The maximum amount of time allowed before a sending side releases the resources used by a conversation. If there is no activity for a conversation for the specified amount of time, the sending agent releases all resources for that conversation and notifies the receiving agent to do the same. A value of 0 specifies that resources for a conversation are not released unless the application explicitly closes the conversation. Updating ConversationIdleTimeMaximum causes connections starting after the update to use the new value.')
safAgentDefaultRetryDelayMaximum = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1035, 1, 18), Counter64()).setMaxAccess("readonly")
if mibBuilder.loadTexts: safAgentDefaultRetryDelayMaximum.setStatus('current')
if mibBuilder.loadTexts: safAgentDefaultRetryDelayMaximum.setDescription('The maximum amount of time, in milliseconds, between two successive delivery retry attempts. Applies only to agents with sending capability. Updating DefaultRetryDelayMaximum causes connections starting after the update to use the new value. Range of Values: &gt; = RetryDelayBase if RetryDelayMultiplier is not 1.0.')
safAgentMaximumMessageSize = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1035, 1, 19), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: safAgentMaximumMessageSize.setStatus('current')
if mibBuilder.loadTexts: safAgentMaximumMessageSize.setDescription('The maximum number of bytes allowed in individual messages on this SAF agent. The message size includes the message body, any user-defined properties, and the user-defined JMS header fields: JMSCorrelationID and JMSType. Producers sending messages that exceed the configured maximum message size for the SAF agent will receive a ResourceAllocationException. The maximum message size is only enforced for the initial production of a message. Messages that are redirected to an error destination or forwarded to a member of a distributed destination are not checked for size. For instance, if a destination and its corresponding error destination are configured with a maximum message size of 128K bytes and 64K bytes, respectively, a message of 96K bytes could be redirected to the error destination (even though it exceeds the 64K byte maximum), but a producer could not directly send the 96K byte message to the error destination. Applies only to agents with sending capability. Updating MaximumMessageSize affects only incoming messages; stored messages are not affected.')
safAgentAcknowledgeInterval = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1035, 1, 20), Counter64()).setMaxAccess("readonly")
if mibBuilder.loadTexts: safAgentAcknowledgeInterval.setStatus('current')
if mibBuilder.loadTexts: safAgentAcknowledgeInterval.setDescription('The maximum interval between two successive acknowledgements sent by the receiving side. Applies only to agents with receiving capability. A value of -1 specifies that there is no time limit between successive acknowledgement. Updating AcknowlegeInterval causes connections starting after the update to use the new value.')
safAgentDeploymentOrder = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1035, 1, 21), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: safAgentDeploymentOrder.setStatus('current')
if mibBuilder.loadTexts: safAgentDeploymentOrder.setDescription('A priority that the server uses to determine when it deploys an item. The priority is relative to other deployable items of the same type. For example, the server prioritizes and deploys all EJBs before it prioritizes and deploys startup classes. Items with the lowest Deployment Order value are deployed first. There is no guarantee on the order of deployments with equal Deployment Order values. There is no guarantee of ordering across clusters.')
safAgentMessageBufferSize = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1035, 1, 22), Counter64()).setMaxAccess("readonly")
if mibBuilder.loadTexts: safAgentMessageBufferSize.setStatus('current')
if mibBuilder.loadTexts: safAgentMessageBufferSize.setDescription('The amount of memory used to store message bodies in memory before they are paged out to disk. A value of -1 (the default) specifies that the server will automatically determine a size based on the maximum heap size of the JVM. This default will be set to either one-third the maximum heap size, or 512 megabytes, whichever is larger. The larger the buffer, the more memory JMS will consume when many messages are waiting on queues or topics. Once the buffer is surpassed, JMS may write message bodies to the directory specified by PagingDirectory in an effort to reduce memory usage below this buffer. Surpassing the buffer size does not stop the JMS server from accepting new messages. It is still possible to run out of memory if messages are arriving faster than they can be written to disk. Users with high messaging loads who wish to support the highest possible availability should consider setting a quota or setting a threshold and enabling flow control. Applies only to agents with sending capability. Paging is always supported. Updating the memory size resets the message count so that only requests arriving after the update are charged against the new memory size.')
safAgentWindowSize = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1035, 1, 23), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: safAgentWindowSize.setStatus('current')
if mibBuilder.loadTexts: safAgentWindowSize.setDescription('For JMS messages, the number of messages in a batch. A sending agent waits to forward a message batch until the source destination message count is greater than or equal to this value. For WSRM, the maximum number of unacknowledged messages allowed between a source destination and a target destination during a conversation.')
safAgentDefaultTimeToLive = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1035, 1, 24), Counter64()).setMaxAccess("readonly")
if mibBuilder.loadTexts: safAgentDefaultTimeToLive.setStatus('current')
if mibBuilder.loadTexts: safAgentDefaultTimeToLive.setDescription('The default amount of time, in milliseconds, that the agent guarantees to reliably send messages. A value of 0 means the agent guarantees to reliably send messages for the duration of the conversation. Updating DefaultTimeToLive causes conversations starting after the update to use the new value.')
safAgentPagingDirectory = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1035, 1, 25), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: safAgentPagingDirectory.setStatus('current')
if mibBuilder.loadTexts: safAgentPagingDirectory.setDescription("Specifies where message bodies are written when the size of the message bodies in the JMS server exceeds the message buffer size. If unspecified, messages are written to the tmp directory in the host WebLogic Server instance's directory. For example, domainName/servers/servername/tmp. For best performance, this directory should not be the same as the directory used by the SAF agent's persistent store. Applies only to agents with sending capability.")
safAgentBytesThresholdLow = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1035, 1, 26), Counter64()).setMaxAccess("readonly")
if mibBuilder.loadTexts: safAgentBytesThresholdLow.setStatus('current')
if mibBuilder.loadTexts: safAgentBytesThresholdLow.setDescription('The lower threshold that triggers events based on the number of bytes stored in the SAF agent. The default value of -1 disables the events for this SAF agent. Applies only to agents with sending capability. Updating BytesThresholdLow affects only new requests. If the number of bytes falls below this threshold, the triggered events are: Log Messages: A message is logged on the server indicating that the threshold condition has cleared. Flow Control: The agent becomes disarmed and instructs producers to beging increasing their message flow. Range of Values: &lt;= BytesThresholdHigh')
safAgentDefaultRetryDelayBase = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1035, 1, 27), Counter64()).setMaxAccess("readonly")
if mibBuilder.loadTexts: safAgentDefaultRetryDelayBase.setStatus('current')
if mibBuilder.loadTexts: safAgentDefaultRetryDelayBase.setDescription('The amount of time, in milliseconds, between the original delivery attempt and the first retry. If RetryDelayMultiplier is set to 1, this defines the interval between any two successive retry attempts. Applies only to agents with sending capability. Updating DefaultRetryDelayBase causes connections starting after the update to use the new value. Range of Values: &lt;= RetryDelayMaximum if RetryDelayMultiplier is not 1.0.')
wlssnmpAgentDeploymentTable = MibTable((1, 3, 6, 1, 4, 1, 140, 625, 1040), )
if mibBuilder.loadTexts: wlssnmpAgentDeploymentTable.setStatus('current')
if mibBuilder.loadTexts: wlssnmpAgentDeploymentTable.setDescription('This MBean is an SNMP agent that can be targeted to instances of WebLogic Server. With SNMP, you configure agents to gather and send data about managed resources in response to a request from managers. You can also configure agents to issue unsolicited reports to managers when they detect predefined thresholds or conditions on a managed resource. In a WebLogic Server domain, you can choose a centralized or de-centralized model for SNMP monitoring and communication: In a centralized model, you create an instance of this MBean and target it only to the Administration Server. This agent communicates with all Managed Servers in the domain. SNMP managers communicate only with the SNMP agent on the Administration Server. This model is convenient but introduces performance overhead in WebLogic Server. In addition, if the Administration Server is unavailable, you cannot monitor the domain through SNMP. In a de-centralized model, you create an instance of this MBean and target it to each Managed Server that you want to monitor. (Alternatively, you can create multiple instances of this MBean and target each instance to an individual Managed Server.) Your SNMP manager must communicate with the agents on individual Managed Servers. To support domains that were created with WebLogic Server release 9.2 and earlier, a domain also hosts a singleton SNMP agent whose scope is the entire domain (see {@link SNMPAgentMBean}). SNMPAgentMBean offers the same features as an instance of this MBean (SNMPAgentDeploymentMBean) that you have targeted as described in the centralized model above. However, the underlying implementation of SNMPAgentMBean is different and it will eventually be deprecated. SNMPAgentMBean is overridden if you target an instance of this MBean to the Administration Server.')
