wlssnmpAgentDeploymentCommunityPrefix = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1040, 1, 4), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: wlssnmpAgentDeploymentCommunityPrefix.setStatus('current')
if mibBuilder.loadTexts: wlssnmpAgentDeploymentCommunityPrefix.setDescription('The password (community name) that you want this SNMP agent to use to secure SNMPv1 or v2 communication with SNMP managers. Requires you to enable community based access for this agent. SNMPv3 does not use community names. Instead, it encrypts user names and passwords in its PDUs. When you use SNMPv1 or v2, there are two community names that are needed when the WebLogic SNMP agent and SNMP managers interact: The name that you specify in this community prefix. All SNMP managers must send this name when connecting to this SNMP agent. The community name that the SNMP manager defines. The SNMP agent must send this name when connecting to the manager. (You supply this community name when you configure a trap destination.) In addition to using the community prefix as a password, an SNMP agent on an Administration Server uses the prefix to qualify requests from SNMP managers. Because the Administration Server can access data for all WebLogic Server instances in a domain, a request that specifies only an attribute name is potentially ambiguous. For example, the attribute serverUptime exists for each WebLogic Server instance in a domain. To clarify requests that you send to SNMP agents on Administration Servers, use the community prefix as follows: To request the value of an attribute on a specific Managed Server, when you send a request from an SNMP manager, append the name of the server instance to the community prefix: community_prefix@server_name. To request the value of an attribute for all server instances in a domain, send a community name with the following form: community_prefix To secure access to the values of the WebLogic attributes when using the SNMPv1 or v2 protocols, it is recommended that you set community prefix to a value other than public. You cannot specify a null (empty) value for the community prefix. If you delete the prefix value, WebLogic Server resets the value to public. If you do not want this agent to receive SNMPv1 or v2 requests, instead of trying to set the community prefix to a null value, disable community based access. With community based access disabled, WebLogic Server ignores the community prefix value.')
wlssnmpAgentDeploymentAuthenticationProtocol = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1040, 1, 5), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: wlssnmpAgentDeploymentAuthenticationProtocol.setStatus('current')
if mibBuilder.loadTexts: wlssnmpAgentDeploymentAuthenticationProtocol.setDescription('The protocol that this SNMP agent uses to ensure that only authorized users can request or receive information about your WebLogic Server domain. Applicable only with SNMPv3. The protocol also ensures message integrity and prevents masquerading and reordered, delayed, or replayed messages. To use this protocol when receiving requests from SNMP managers, you must configure credential mapping in the WebLogic Server security realm. To use this protocol when sending responses or notifications, you must configure the security level of your trap destinations. If you do not choose an authentication protocol, then the SNMP agent does not authenticate incoming SNMPv3 requests; anyone can use SNMPv3 to retrieve information about your WebLogic Server domain.')
wlssnmpAgentDeploymentSNMPPort = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1040, 1, 6), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: wlssnmpAgentDeploymentSNMPPort.setStatus('current')
if mibBuilder.loadTexts: wlssnmpAgentDeploymentSNMPPort.setDescription("The port on which you want this SNMP agent to listen for incoming requests from SNMP managers that use the UDP protocol. SNMP managers can use this port to ping the SNMP agent and request the status of specific attributes. If you target this SNMP agent to multiple server instances, and if two or more servers are running on the same computer, WebLogic Server will automatically increment this UDP port value by 1 for each agent. WebLogic Server never assigns port 162 because it is the default port that an agent uses to send notifications. In addition, if any port is already in use, WebLogic Server skips the port and assigns the next available port. For example, if you use the default value of this attribute and then target this agent to ManagedServer1 and ManagedServer2, and if both servers are running on the same computer, then the agent on ManagedServer1 will listen on UDP port 161 and the agent on ManagedServer2 will listen on UDP port 163. The incremented port number is not persisted in the domain's configuration; when WebLogic Server increments port numbers, it does so in the order in which servers are started on the same computer. If WebLogic Server re-assigns the UDP port for an SNMP agent, look in the agent's SNMPAgentRuntimeMBean to see the agent's runtime UDP port. SNMP agents can also communicate through the host server's TCP listen port (7001 by default) or through a TCP port that is configured by a custom network channel.")
wlssnmpAgentDeploymentSNMPEngineId = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1040, 1, 7), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: wlssnmpAgentDeploymentSNMPEngineId.setStatus('current')
if mibBuilder.loadTexts: wlssnmpAgentDeploymentSNMPEngineId.setDescription('An identifier for this SNMP agent that is unique amongst all other SNMP agents in the current WebLogic Server domain. If you use SNMPv3 to send messages to this SNMP agent, you must specify the SNMP engine ID when you configure the SNMP manager. For an SNMP agent on an Administration Server, the default value is the name of the WebLogic Server domain. For an agent on a Managed Server, the default is the name of the server.')
wlssnmpAgentDeploymentSNMPAccessForUserMBeansEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1040, 1, 8), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: wlssnmpAgentDeploymentSNMPAccessForUserMBeansEnabled.setStatus('current')
if mibBuilder.loadTexts: wlssnmpAgentDeploymentSNMPAccessForUserMBeansEnabled.setDescription('Configures this SNMP agent to provide read-only access to MBean types that you have created and registered (custom MBeans). If you enable this access, when you register a custom MBean in a WebLogic Server MBeanServer, this SNMP agent dynamically updates a runtime MIB module that WebLogic Server maintains for custom MBeans. For each custom MBean type, WebLogic Server adds a table to the MIB module. For each instance of the custom MBean, it adds a table row. While WebLogic Server does not persist the MIB as a file or other data structure, the OIDs in the MIB remain constant across server sessions. The MIB module for custom MBeans is managed by a subAgent. Its master agent is this WebLogic Server SNMP agent and it communicates with the master agent through the AgentX port.')
wlssnmpAgentDeploymentLocalizedKeyCacheInvalidationInterval = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1040, 1, 9), Counter64()).setMaxAccess("readonly")
if mibBuilder.loadTexts: wlssnmpAgentDeploymentLocalizedKeyCacheInvalidationInterval.setStatus('current')
if mibBuilder.loadTexts: wlssnmpAgentDeploymentLocalizedKeyCacheInvalidationInterval.setDescription("The number of milliseconds after which WebLogic Server invalidates its cache of SNMP security keys. Setting a high value creates a risk that users whose credentials have been removed can still access SNMP data. An SNMP security key is an encrypted version of an SNMP agent's engine ID and an authentication password or privacy password. WebLogic Server generates one security key for each entry that you create in the SNMP credential map. When a WebLogic Server SNMP agent receives an SNMPv3 request, it compares the key that is in the request with its WebLogic Server keys. If it finds a match, it processes the request. The SNMP agent also encodes these keys in its responses and notifications. (You configure which keys are encoded when you create a trap destination.) Instead of regenerating the keys for each SNMPv3 communication, WebLogic Server caches the keys. To make sure that the cache contains the latest set of SNMP credentials, WebLogic Server periodically invalidates the cache. After the cache is invalidated, the next time an SNMP agent requests credentials, WebLogic Server regenerates the cache. Note that making a change to the credential map does not automatically update the cache. Instead, the cache is updated only after it has been invalidated. For example, if you update a privacy password in an existing entry in the SNMP credential map, the SNMP agent is not aware of the new password until the key cache is invalidated and regenerated. An SNMP user with the old security password can still access WebLogic Server data until the cache is invalidated. You can invalidate a key immediately instead of waiting for this invalidation interval to expire.")
