wlssnmpAgentDeploymentInformEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1040, 1, 12), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: wlssnmpAgentDeploymentInformEnabled.setStatus('current')
if mibBuilder.loadTexts: wlssnmpAgentDeploymentInformEnabled.setDescription("Configures this SNMP agent to send notifications as an INFORM instead of a TRAP. Requires you to specify the agent's SNMPTrapVersion as SNMPv2 or SNMPv3. When an agent sends an INFORM notification, it waits for a confirmation response from the SNMP manager. If it does not receive a response, it resends the INFORM notification.")
wlssnmpAgentDeploymentSendAutomaticTrapsEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1040, 1, 13), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: wlssnmpAgentDeploymentSendAutomaticTrapsEnabled.setStatus('current')
if mibBuilder.loadTexts: wlssnmpAgentDeploymentSendAutomaticTrapsEnabled.setDescription('Specifies whether this SNMP agent sends automatically generated notifications to SNMP managers. The SNMP agent generates automatic notifications when any of the following events occur: The WebLogic Server instance that is hosting the SNMP agent starts. This type of notification (coldStart) has no variable bindings. A server instance starts or stops. An SNMP agent on a Managed Server generates these notifications only when its host Managed Server starts or stops. An SNMP agent on an Administration Server generates these notifications when any server in the domain starts or stops. These notification types (serverStart and serverShutdown) contain variable bindings to identify the server that started or stopped and the time at which the notification was generated.')
wlssnmpAgentDeploymentInformRetryInterval = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1040, 1, 14), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: wlssnmpAgentDeploymentInformRetryInterval.setStatus('current')
if mibBuilder.loadTexts: wlssnmpAgentDeploymentInformRetryInterval.setDescription('The number of milliseconds that this SNMP agent will wait for a response to an INFORM notification. If the agent does not receive a response within the specified interval, it will resend the notification.')
wlssnmpAgentDeploymentDeploymentOrder = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1040, 1, 15), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: wlssnmpAgentDeploymentDeploymentOrder.setStatus('current')
if mibBuilder.loadTexts: wlssnmpAgentDeploymentDeploymentOrder.setDescription('A priority that the server uses to determine when it deploys an item. The priority is relative to other deployable items of the same type. For example, the server prioritizes and deploys all EJBs before it prioritizes and deploys startup classes. Items with the lowest Deployment Order value are deployed first. There is no guarantee on the order of deployments with equal Deployment Order values. There is no guarantee of ordering across clusters.')
wlssnmpAgentDeploymentPrivacyProtocol = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1040, 1, 16), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: wlssnmpAgentDeploymentPrivacyProtocol.setStatus('current')
if mibBuilder.loadTexts: wlssnmpAgentDeploymentPrivacyProtocol.setDescription('The protocol that this SNMP agent uses to encrypt and unencrypt messages. Applicable only with SNMPv3. Requires you to also use an authentication protocol. To use this protocol when sending responses or notifications, you must also configure the security level of your trap destinations. If you do not choose a privacy protocol, then communication between this agent and managers can be viewed (but not altered) by unauthorized users.')
wlssnmpAgentDeploymentMasterAgentXPort = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1040, 1, 17), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: wlssnmpAgentDeploymentMasterAgentXPort.setStatus('current')
if mibBuilder.loadTexts: wlssnmpAgentDeploymentMasterAgentXPort.setDescription('The port that this SNMP agent uses to communicate with its subagents. The agent uses subagents to provide access to custom MBeans (MBeans that you create and register) and to other BEA software components. WebLogic Server SNMP agents do not enable users to register their own subagents.')
