wlssnmpAgentDeploymentCommunityBasedAccessEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1040, 1, 20), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: wlssnmpAgentDeploymentCommunityBasedAccessEnabled.setStatus('current')
if mibBuilder.loadTexts: wlssnmpAgentDeploymentCommunityBasedAccessEnabled.setDescription('Specifies whether this SNMP agent supports SNMPv1 and v2. SNMPv1 and v2 use community strings for authentication. If you disable community strings for this SNMP agent, the agent will process only SNMPv3 requests. If an SNMP manager sends a v1 or v2 message, the agent discards the message and returns an error code to the manager.')
wlssnmpAttributeChangeTable = MibTable((1, 3, 6, 1, 4, 1, 140, 625, 1045), )
