webAppContainerReloginEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1155, 1, 7), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: webAppContainerReloginEnabled.setStatus('current')
if mibBuilder.loadTexts: webAppContainerReloginEnabled.setDescription('Beginning with the 9.0 release the FORM/BASIC authentication behavior has been modified to conform strictly to the J2EE Specification. If a user has logged-in but does not have privileges to access a resource, the 403 (FORBIDDEN) page will be returned. Turn this flag on to enable the old behavior, which was to return the user to the login form.')
webAppContainerWorkContextPropagationEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1155, 1, 8), OctetString()).setMaxAccess("readonly")
