if mibBuilder.loadTexts: webAppContainerRtexprvalueJspParamName.setDescription("Global property which determines the behavior of the JSP compiler when a jsp:param attribute 'name' has a request time value. Without this property set to 'true', the JSP compiler throws an error for a JSP using a request time value for the 'name' attribute as mandated by the JSP 2.0 spec. This property exists for backward compatibility.")
webAppContainerFilterDispatchedRequestsEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1155, 1, 10), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: webAppContainerFilterDispatchedRequestsEnabled.setStatus('current')
if mibBuilder.loadTexts: webAppContainerFilterDispatchedRequestsEnabled.setDescription("Indicates whether or not to apply filters to dispatched requests. This is a backward compatibility flag. Until version 8.1, WebLogic Server applied ServletFilters (if configured for the Web application) on request dispatches (and includes/forwards). Servlet 2.4 has introduced the 'Dispatcher' element to make this behavior explicit. The default value is Dispatcher=REQUEST. In order to be complaint with the J2EE specification, the default value for FilterDispatchedRequestsEnabled is false beginning with WebLogic Server 9.0. Note that if you are using old descriptors (meaning web.xml does not have version=2.4), then WebLogic Server automatically uses FilterDispatchedRequestsEnabled = true for the Web applications, unless filter-dispatched-requests-enabled is explicitly set to false in weblogic.xml. This means that old applications will work fine without any modification. Additionally, during migration of old domains to the 9.0 domain, the migration plugin automatically sets this flag to true.")
webAppContainerClientCertProxyEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1155, 1, 11), OctetString()).setMaxAccess("readonly")
