webAppContainerOverloadProtectionEnabled = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1155, 1, 12), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: webAppContainerOverloadProtectionEnabled.setStatus('current')
if mibBuilder.loadTexts: webAppContainerOverloadProtectionEnabled.setDescription('This parameter is used to enable overload protection in the webapp container against low memory conditions. When a low memory situation occurs, new session creation attempts will result in weblogic.servlet.SessionCreationException. The application code needs to catch this exception and take proper action. Alternatively appropriate error-pages can be configured in web.xml against weblogic.servlet.SessionCreationException. This check is performed only on memory and replicated sessions.')
webAppContainerOptimisticSerialization = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1155, 1, 13), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: webAppContainerOptimisticSerialization.setStatus('current')
if mibBuilder.loadTexts: webAppContainerOptimisticSerialization.setDescription('When OptimisticSerialization is turned on, WebLogic server does not serialize-deserialize context and request attributes upon getAttribute(name) when a request gets dispatched across servlet contexts. This means you will need to make sure that the attributes common to Web applications are scoped to a common parent classloader (they are application-scoped) or placed in the system classpath if the two Web applications do not belong to the same application. When OptimisticSerialization is turned off (which is the default) WebLogic Server does serialize-deserialize context and request attributes upon getAttribute(name) to avoid the possibility of ClassCastExceptions. The value of OptimisticSerialization can also be overridden for specific Web applications by setting the optimistic-serialization value in weblogic.xml.')
webAppContainerRetainOriginalURL = MibTableColumn((1, 3, 6, 1, 4, 1, 140, 625, 1155, 1, 14), OctetString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: webAppContainerRetainOriginalURL.setStatus('current')
if mibBuilder.loadTexts: webAppContainerRetainOriginalURL.setDescription('retain-original-url is used in FORM based authentication scenarios. When this property is set to true, after a successful authentication, Weblogic Server will redirect back to the web resource (page/servlet) retaining the protocol (http/https) used to access the protected resource in the original request. If set to false (which is the default value), Weblogic Server will redirect back to the protected resource using the current protocol. retain-original-url value can also be specified at per webapp level in weblogic.xml. The value in weblogic.xml, if specified, overrides the domain level value.')
